-- Records of missive
-- ----------------------------
INSERT INTO `missive` VALUES (10001, '发布于4月18日并于4月19日进行更新的一份通告', 1, 2, 114, 116, 28, 103, '<p>啦啦啦啦<img class=\"wscnph\" src=\"data:image/jpeg;base64,\" />哈哈哈哈</p>\n<pre class=\"language-java\"><code>import org.junit.Test;\n\n/**\n * @author hwb\n * @create 2022-03-20\n */\npublic class Test1 {\n\n    @Test\n    public void test() {\n        System.out.println(uniquePaths(3, 3));\n    }\n\n    public int uniquePaths(int m, int n) {\n        int[][] dp = new int[m][n];\n        for (int i = 0; i &lt; m; i++) {\n            for (int j = 0; j &lt; n; j++) {\n                if (i == 0 || j == 0) {\n                    dp[i][j] = 1;\n                } else {\n                    dp[i][j] = dp[i - 1][j] + dp[i][j - 1];\n                }\n            }\n        }\n        return dp[m - 1][n - 1];\n    }\n\n}</code></pre>', NULL, 'admin', '2022-04-18 20:36:47', 'admin', '2022-04-19 15:48:41', b'0');

